import React, {Component} from "react"
import PostList from "./PostList"
import PropTypes from "prop-types"





class Posts extends Component{

	render(){
		return(
			<div>
				<ol className="list">
					{
						this.props.postList.map((post) =>
							<PostList
							id={post.id}
							title={post.title}
							body={post.body}
							/>
						)
					}
				</ol>

			</div>
		)
	}
}

Posts.PropTypes = {
	postList: PropTypes.array
}

export default Posts;
